import axios from "axios";
import React from "react";

function Car({ name, category, qty, pic }) {
    return (
      <div className="card" style={{ width: "18rem" }}>
        <img src={pic} className="card-img-top" alt={name} />
        <div className="card-body">
          <h5 className="card-title">{name}</h5>
          <p className="card-text">Category: {category}</p>
          <p className="card-text">Quantity: {qty}</p>
          <a href="#" className="btn btn-primary">
            Go somewhere
          </a>
        </div>
      </div>
    );
  }
  

function Card() {
  async function Exec() {
    console.log("hello f2");
    try {
      console.log("hello f1");
      let r = await axios.get("http://localhost:2001/home");
      console.log(r.data);
      r.data.map((val,ind)=>{
        console.log(val,ind);
        Car(val.name,val.category,val.qty,val.pic);
      });
    } catch (err) {
      console.log(err);
    }
  }

  Exec(); // Call the function directl
}

export { Card };
